@Ultra Paraguay Casi pero no. Aunque puede ser porque el acento norcoreano suena muy rústico, pueblerino, campirano y algo inocente. En cambio, el surcoreano suena más versátil, moderno, urbano y hasta listillo si los comparas. Ya te habrás dado cuenta la similitud no? Acento norcoreano: México. 
Acento surcoreano: Argentina.
Así que tienes un buen punto. Si no me creen escuchen ambos acentos por un buen tiempo, memoricen sus patrones, velocidad, estilo, etc., y luego hagan el simil.

